import { Container, Stack, useMediaQuery } from "@mui/material";
import { motion } from "framer-motion";

const Header = ({}) => {
  const Media = useMediaQuery("(min-width:1070px)")
  return (
    <div>
      <Container maxWidth={"lg"}>
        <Stack spacing={"4"} direction={`${Media?"row":"column"}`}  display={"flex"} justifyContent={"space-between"} style={{ backgroundColor:"black" }} >
          <Stack>
            <h1 className="text-white">hello</h1>
          </Stack>
          <Stack spacing={"20px"} width={`${Media?"500px":"80%"}`} style={{ backgroundColor:"blue" }} height={`${Media?"500px":"200px"}`}>
            <h1 className="">hello hii </h1></Stack>
        </Stack>
      </Container>
    </div>
  );
};

export default Header;
